import axios from "axios";
import { useEffect, useState } from "react"

const url = `http://localhost:8080/carClasses`;

const useFetch = () => {

    const fetch = (type) => {
        switch(type) {
            case 'list':
                axios.get(url).then((res) => console.log(res)).catch((err) => console.log(err));
                break;
            case 'detail':
                break;
            default:
                break;
        }
    }
    return {fetch};
}

export default useFetch;
